import { Link } from 'react-router-dom'

import Logo from '../../images/logo.jpg'

function Home() {

  return (
    <div className='nav-bar'>
      <img src={Logo} />
      <Link to='/about' className='nav-about'>About Us</Link>
    </div>
    // <h1>La Cruche Homepage</h1>

  )

}

export default Home
